import React from 'react'
import axios from 'axios'
import { useEffect, useState } from 'react';
import { NavLink } from 'react-router-dom'
import '../App.css'


function Login() {
  const [data, setData] = useState([]);
  let comprobacion = true;
  const acceso = () => {
    if(comprobacion === true){
      <NavLink/>
    }
  }

  useEffect(() => {
    // Realizar la petición GET cuando el componente se monte
    axios.get('http://localhost:8080/api/usuarios')
      .then(response => {
        // setData(response.data);
        console.log(response.data);
      })
      .catch(error => {
        console.error('Error al obtener los datos:', error);
      });
  }, []);

  return (
    <div className='imagen'>
      <div className='contenedorLogin'>
        <div className='login'>
          <input className='botonesLogin usuario' placeholder='Usuario'/>
          <input className='botonesLogin usuario' placeholder='Cotraseña'/>
          <button onClick={acceso} className='botonesLogin entrarLogin'>Entrar</button>
        </div>
      </div>
    </div>
  )
}

export default Login
